// divide returns x%y.
func divide(x, y V) V {
	if x.IsInt() {
		return divideIV(x.I(), y)
	}
	switch xv := x.Value.(type) {
	case F:
		return divideFV(xv, y)
	case *AB:
		return divideABV(xv, y)
	case *AF:
		return divideAFV(xv, y)
	case *AI:
		return divideAIV(xv, y)
	case *AV:
		switch yv := y.Value.(type) {
		case array:
			if yv.Len() != xv.Len() {
				return errf("x%%y : length mismatch: %d vs %d", xv.Len(), yv.Len())
			}
			r := xv.reuse()
			for i, xi := range xv.Slice {
				ri := divide(xi, yv.at(i))
				if ri.IsErr() {
					return ri
				}
				r.Slice[i] = ri
			}
			return NewV(r)
		}
		r := xv.reuse()
		for i, xi := range xv.Slice {
			ri := divide(xi, y)
			if ri.IsErr() {
				return ri
			}
			r.Slice[i] = ri
		}
		return NewV(r)
	default:
		return errTypeElt("x%%y", "x", x)
	}
}

