func modulusIV(x int64, y V) V {
	if y.IsInt() {
		return NewI(modI(x, y.I()))
	}
	switch yv := y.Value.(type) {
	case F:
		return NewV(F(modF(F(x), F(yv))))
	case *AB:
		r := make([]int64, yv.Len())
		for i := range r {
			r[i] = int64(modI(x, B2I(yv.At(i))))
		}
		return NewAI(r)
	case *AF:
		r := yv.reuse()
		for i := range r.Slice {
			r.Slice[i] = float64(modF(F(x), F(yv.At(i))))
		}
		return NewV(r)
	case *AI:
		r := yv.reuse()
		for i := range r.Slice {
			r.Slice[i] = int64(modI(x, yv.At(i)))
		}
		return NewV(r)
	case *AV:
		r := yv.reuse()
		for i, yi := range yv.Slice {
			ri := modulusIV(x, yi)
			if ri.IsErr() {
				return ri
			}
			r.Slice[i] = ri
		}
		return NewV(r)
	default:
		return errTypeElt("x mod y", "y", y)
	}
}

